INSERT INTO `descripcion_pqrs` VALUES (1,'Ruido excesivo','Fiestas, música alta, mascotas, vecinos ruidosos, construcción o mantenimiento fuera de horario permitido.',2),(2,'Zonas comunes','Mal estado, uso indebido, falta de limpieza o mantenimiento en ascensores, gimnasio, piscina, parqueaderos, entre otros.',2),(3,'Mascotas','Ruidos, desechos en áreas comunes, circulación sin correa o razas restringidas.',2),(4,'Parqueaderos','Uso indebido, invasión de cupos, problemas de asignación o falta de espacios.',2),(5,'Convivencia y conflictos entre vecinos','Falta de respeto, incumplimiento del reglamento, disputas por áreas comunes.',2),(6,'Administración y vigilancia','Mal servicio, falta de transparencia en la gestión financiera, deficiencias en seguridad o trato inadecuado por parte del personal.',2),(7,'Servicios públicos','Fallos en suministro de agua, electricidad o ascensores, así como problemas de alcantarillado o iluminación en zonas comunes.',2),(8,'Seguridad','Robos, acceso no autorizado, fallas en el control de ingreso y salida.',2),(9,'Cobro de cuotas de administración','Inconformidad con incrementos, falta de claridad en los estados de cuenta o morosidad de otros residentes que afectan el mantenimiento.',2),(10,'Mantenimiento y obras','Retrasos en reparaciones, falta de mantenimiento preventivo, costos elevados o mala calidad en las obras realizadas.',2),(11,'Puertas automáticas','Presentan problemas con su uso.',2),(12,'Problemas con los controles de acceso','Fallas en los controles remotos, tarjetas de acceso o sensores de proximidad.',2),(13,'Mantenimiento de zonas comunes','Reparación de áreas verdes, juegos infantiles, senderos, gimnasio, ascensores, etc.',1),(14,'Mejoras en seguridad','Instalación o mantenimiento de cámaras, refuerzo en la vigilancia, mejor control de acceso.',1),(15,'Revisión y mantenimiento de puertas automáticas','Solicitar arreglos, mantenimiento preventivo o reemplazo si presentan fallas constantes.',1),(16,'Actualización de reglamento de convivencia','Modificaciones en normas sobre mascotas, ruido, parqueaderos o uso de áreas comunes.',1),(17,'Transparencia en la administración','Solicitud de informes detallados de gastos, inversiones y presupuesto.',1),(18,'Mejoras en iluminación','Instalación de más luminarias o reemplazo de las dañadas en parqueaderos y pasillos.',1),(19,'Control del ruido','Medidas para reducir fiestas ruidosas, restricción de horarios o aislamiento acústico en ciertas zonas.',1),(20,'Reducción o ajuste en cuotas de administración','Evaluación de costos y justificación de incrementos.',1),(21,'Mayor frecuencia en la recolección de basuras','Mejor gestión de residuos y puntos ecológicos.',1),(22,'Instalación de nuevas comodidades','Bancas, zonas de sombra, estaciones de carga para celulares, dispensadores de bolsas para desechos de mascotas.',1),(23,'Fallas en puertas automáticas','Solicitar reparación urgente por problemas recurrentes que afectan la seguridad y movilidad.',3),(24,'Deficiencias en seguridad','Quejas por robos, accesos no controlados o falta de vigilancia efectiva.',3),(25,'Incumplimiento de mantenimiento','Retrasos o mala calidad en reparaciones de ascensores, fachadas, parqueaderos, etc.',3),(26,'Ruido excesivo','Reclamos contra vecinos que no respetan horarios de descanso.',3),(27,'Mala administración','Falta de transparencia en gastos, irregularidades en la contabilidad o mala gestión de recursos.',3),(28,'Problemas con la recolección de basuras','Acumulación de residuos, olores o disposición inadecuada.',3),(29,'Uso indebido de zonas comunes','Residentes que ocupan espacios sin autorización o sin respetar normas.',3),(30,'Fallas en el suministro de agua o energía','Cortes constantes o problemas en las instalaciones internas.',3),(31,'Cobros indebidos o errores en cuotas de administración','Errores en facturación, cobros excesivos o falta de claridad en los incrementos.',3),(32,'Conflictos con la vigilancia o personal del conjunto','Mal trato, falta de atención o incumplimiento de funciones.',3),(33,'Solicitud de mantenimiento','Pedir reparación de ascensores, puertas automáticas, luminarias, zonas comunes, etc.',4),(34,'Solicitud de información','Pedir estados financieros, actas de reuniones o detalles sobre cobros de administración.',4),(35,'Solicitud de mejora en seguridad','Instalación de más cámaras, mayor control de acceso, refuerzo en vigilancia.',4),(36,'Solicitud de reuniones con la administración','Pedir asambleas extraordinarias para tratar temas urgentes.',4),(37,'Solicitud de autorización','Uso de salones comunales, adecuaciones en apartamentos, instalación de aires acondicionados o cerramientos.',4),(38,'Solicitud de control del ruido','Aplicación de medidas para reducir fiestas ruidosas o actividades que afecten la convivencia.',4),(39,'Solicitud de ajuste en normativas','Propuesta de cambios en el reglamento del conjunto.',4),(40,'Solicitud de limpieza y recolección de basuras','Mayor frecuencia en la recolección o instalación de más contenedores.',4),(41,'Solicitud de mantenimiento de jardines y zonas verdes','Podas, riego o reforestación en áreas comunes.',4),(42,'Solicitud de mejora en parqueaderos','Asignación de cupos, mantenimiento o control de vehículos no autorizados.',4),(43,'Solicitud especial','Grandes ingresos y egresos como las mudanzas.',4);
